import React from "react";

export default function WorkCard(props){
    return(
        <div className="work-box">
            <img id="work-img" src={`../${props.item.thumbnail}`} alt="" />
            <div id="work-">
                <h3 id="work-heading">{props.item.title}</h3>
                <p id="work-desc">{props.item.desc}</p>
            </div>
        </div>
    )
}
